import React, { useState } from "react";
import HighlightedArea from "./HighlightedArea";

interface AbdomenState {
  umbilicus: boolean;
  suprapubic: boolean;
  ruq: boolean;
  rlq: boolean;
  luq: boolean;
  llq: boolean;
  epigastrium: boolean;
  selectAll: boolean;
}
const AreaSelector = () => {
  const [selectedAbdomen, setSelectedAbdomen] = useState<AbdomenState>({
    umbilicus: false,
    suprapubic: false,
    ruq: false,
    rlq: false,
    luq: false,
    llq: false,
    epigastrium: false,
    selectAll: false,
  });

  const toggleArea = (area: keyof AbdomenState) => {
    if (area === "selectAll") {
      setSelectedAbdomen({
        umbilicus: true,
        suprapubic: true,
        ruq: true,
        rlq: true,
        luq: true,
        llq: true,
        epigastrium: true,
        selectAll: true,
      });
    } else {
      setSelectedAbdomen((prevState) => ({
        ...prevState,
        [area]: !prevState[area], // Toggle the selected area
        selectAll: false,
      }));
    }
  };
  const baseImage = "/images/default-abdomen.png";
  const abdomenAreas = [
    "umbilicus",
    "suprapubic",
    "ruq",
    "rlq",
    "luq",
    "llq",
    "epigastrium",
  ];
  const highlightImages: {
    abdomen: { [key: string]: string };
  } = {
    abdomen: {},
    finger: {},
  };
  const labels: {
    abdomen: { [key: string]: string };
    finger: { [key: string]: string };
  } = {
    abdomen: {},
    finger: {},
  };
  abdomenAreas.forEach((abdomenArea) => {
    highlightImages.abdomen[abdomenArea] =
      `/images/${abdomenArea}-highlight.png`;
    labels.abdomen[abdomenArea] = selectedAbdomen.selectAll
      ? ""
      : `/images/${abdomenArea}-active.png`;
  });
  return (
    <div className="relative">
      <img
        className="justify-center items-center"
        src={baseImage}
        alt="default-abs"
      />
      {Object.keys(selectedAbdomen).map((abdomenArea) => (
        <HighlightedArea
          key={abdomenArea}
          isSelected={selectedAbdomen[abdomenArea as keyof AbdomenState]}
          highlightImage={highlightImages[area][abdomenArea]}
          labelImage={labels[area]?.[abdomenArea]}
          position={{ top: "0", left: "0" }} // Customize the position as needed
          altText={selectedAbdomen.selectAll ? "" : abdomenArea}
        />
      ))}
